import logo from './images/Group 1.png' ;
import icon1 from './images/Vector.png' ;
import icon2 from './images/Vector (2).png' ;
import icon3 from './images/Vector (1).png' ;
import './css/home.css';
import { BrowserRouter, Link , Route,Routes,NavLink, Router,Switch } from 'react-router-dom';
import Home from './home';

function App() {
  return (
    <div className="App">
          <BrowserRouter >
            <div class="navbar">
              <ul class="left">
                  <li> <a href=""> <img src={logo} alt=""/></a></li>
              </ul>

          <div class="center">

            <NavLink to= "/"> Home    </NavLink>
            <NavLink to= "/men"> Men    </NavLink>
            <NavLink to= "/women"> Women    </NavLink>
            <NavLink to= "/machines"> Machines    </NavLink>

          </div>
          <div class="right">
            <NavLink to= "/favoris">  <img src={icon1} alt=""/>   </NavLink>
            <NavLink to= "/panier"> <img src={icon2} alt=""/>   </NavLink>
            <NavLink to= "/compte">  <img src={icon3} alt=""/> </NavLink>

          </div>
          </div>
        </BrowserRouter>

        <Router>
          <Switch>
          <Route path="/" component={<Home />} />
          </Switch>
        </Router>
    </div>
  );
}

export default App;
